  \"2016-04-01T18:54:54.397606\",\n\t\"name\": \"department-of-health-gts-surficial-aquifers\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This files contains pesticide drastic scores,
  chemical use surrogate scores, permitted water volumes, UIC Drastic scores, and
  total monitoring scores as referenced in the online NDDoH Report, 'Geographic Targeting
  System for Groundwater Monitoring' published in 1997. This data was used for prioritizing
  aquifers in the Department of Health, Division of Water Quality aquifer monitoring
  program; specifically targeting aquifers that have a high potential for pesticide
  contamination. This data was developed from surficial aquifers mapped as of 1997
  and represents a snapshot in time. nnThe North Dakota Department of Health plans
  to have new targeting system rankings ready for the start of a new 5-year aquifer
  monitoring cycle that will begin in 2017. The ranking is based on compiling soil
  data, water use, pesticide use, crop data and other data as outlined in the original
  Geographic Targeting System for Groundwater Monitoring Report. The North Dakota
  Department of Health anticipates that this work should be done by early 2017, and
  an updated version of the u201cGeographic Targeting System for Groundwater Monitoringu201d
  will be published shortly thereafter.\",\n\t\"license_title\": null,\n\t\"extras\":
